export function addSprite(sprite,uniqueKey){
  return {
    type:'ADD_SPRITE',
    payload:{sprite,uniqueKey}
  }
}

export function selectSprite(selectedSprite){
  return {
    type:'SELECT_SPRITE',
    selectedSprite
  }
}
